member.summary:
Use this static method to request an instance of the EMDKManager object. Clients must implement EMDKManager.IEMDKListener to get notified of the EMDK manager status and to get the EMDKManager object.

        Example Usage:
        EMDKResults results = EMDKManager.GetEMDKManager(Android.App.Application.Context, this);

This method returns an object instance which has derived from EMDKBase. Based on the type given, the object needs to be type-casted before used. Calling this method EMDKManager.getInstance(EMDKManager.FEATURE_TYPE) before EMDKManager opened will return null.

        Example Usage:
        VersionManager versionManager = (VersionManager)emdkManager.GetInstance(EMDKManager.FEATURE_TYPE.Version);

This method releases all the resources constructed by EMDKManager. EMDKManager can't be used after this call. The clients must call this method before exiting the application.

        Example Usage:
          emdkManager.Release();

This method releases resources of a given manager type. Instance variable is not required as multiple instances are not allowed by design.

        Example Usage:
          emdkManager.Release(EMDKManager.FEATURE_TYPE.Profile);

Called to notify the client that this EMDKManager object has been abruptly closed. The clients must call EMDKManager.Release() to free all the resources used by EMDKManager even after onClosed(). 

        Example Usage:
        public void OnClosed()
        {
            if (emdkManager != null)
            {
                emdkManager.Release();
                emdkManager = null;
            }
       }

Called to notify the client when the EMDKManager object has been opened and its ready to use.

        Example Usage:
        public void OnOpened(EMDKManager emdkManagerInstance)
        {
        this.emdkManager = emdkManagerInstance;
        }
